import React from 'react';

function User(props) {
    const { details } = props;

    if(!details) {
        return <h3> Working fetching your team member details...</h3>
    }

    return(
        <div className="user-container">
            <h2>{details.name}</h2>
            <p>Email: {details.email}</p>
        </div>
    )

 };

 export default User;
